"original": |2-
     This REQUIRED operation allows a Client to retrieve the list of Jobs
     belonging to the target Printer.  The Client can also supply a list
     of Job attribute names and/or attribute group names.  A group of Job
     attributes will be returned for each Job that is returned.
"fixed": |-
  This REQUIRED operation allows a Client to retrieve the list of Jobs belonging to the target Printer.  The Client can also supply a list of Job attribute names and/or attribute group names.  A group of Job attributes will be returned for each Job that is returned.
"ko": |-
  이 필수 작업을 통해 클라이언트는 대상 프린터에 속한 작업 목록을 검색할 수 있습니다. 클라이언트는 작업 속성 이름 및/또는 속성 그룹 이름 목록을 제공할 수도 있습니다. 반환된 각 작업에 대해 작업 속성 그룹이 반환됩니다.
